ent adjusted to support Human Geography information.  The web map consists of 3 vector tile layers:</div><div><br /></div><div><ul><li>A label reference layer including cities and communities, countries, administrative units, and at larger scales street names.</li><li>A detail reference layer including administrative boundaries, roads and highways, and larger bodies of water. This layer is designed to be used with a high degree of transparency so that the detail does not compete with your information. It is set at approximately 60% in this web map, but can be adjusted.</li><li>A simple basemap consisting of land areas in a very light gray only.</li></ul></div><div>For an example of how to best use this basemap, view this <a href='https://nation.maps.arcgis.com/apps/MapSeries/index.html?appid=33caf0001a484afea3b555acb0a199cd' target='_blank'>Demographics and Statistics Atlas</a> app.</div><div><br /></div><div>The layers in this map provide unique capabilities for customization, high-resolution display, and offline use in mobile devices: They are built using the same data sources used for the <a href='https://www.arcgis.com/home/item.html?id=8b3d38c0819547faa83f7b7aca80bd76' target='_blank'>Light Gray Canvas</a> and other Esri basemaps.  </div><div><br /></div><div>This map was designed and created by Andrew Skinner.</div><div><br /></div>","tags":["vector","basemap","esri_vector","sample","web map","human geography","esri_basemap","Andrew Skinner","style"],"snippet":"This web map consists of vector tile layers that form a detailed basemap for the world, featuring a monochromatic style with content adjusted to support Human Geography information.","thumbnail":"thumbnail/thumbnail1579117155225.jpeg","documentation":null,"extent":[[-155.166,-45.5959],[104.4629,66.854]],"categories":[],"spatialReference":null,"accessInformation":"Sources: Esri, HERE, Garmin, FAO, NOAA, USGS, © OpenStreetMap contributors, and the GIS User Community","licenseInfo":"<img alt='' src='https:
